import React from 'react'
//import {Typography} from '@material-ui/core';
//import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField'
import Grid from '@material-ui/core/Grid';
import { useState } from 'react';
import InputMask from 'react-input-mask';


export default function RegisterMember(props){

    const [CNIC, setCNIC] = useState('');
    
     

    return(
        <div>
        
        <Grid container  direction="column">

            <Grid container >
                <TextField label="First Name" variant="outlined"/>
                <TextField label="Last Name" variant="outlined"/> 
            </Grid>

            <Grid>
                <InputMask mask="99999-9999999-9" maskChar=" " value={CNIC} onChange={(event)=>{setCNIC(event.target.value)}} >
                    {()=><TextField label="CNIC" variant="outlined" />}
                </InputMask>

            </Grid>

            <Grid>
                <TextField label="Phone Number" variant="outlined" inputProps={{maxLength: 13}}/>
            </Grid>

            <Grid>
                <TextField label="Address" multiline rows={4} defaultValue=""/>
            </Grid>
        
            <Grid>
                <TextField  label="Date of Birth" type="date" defaultValue="2017-05-24"/>
            </Grid>
            
                    
        </Grid>
        
        </div>  
    )

};
